window.bookSummaryJSON = "<p>The national best-selling author of <i>Royal Blood</i> whisks her heroine away to the French Riviera for fun-and danger. </p> <p>Lady Georgiana Rannoch has once again been called into service by Her Majesty the Queen. This time she's sent to Nice on a secret assignment that's nothing to sneeze at: recover the Queen's stolen snuff box. </p> <p>As much of an honor as it is to be trusted by Her Majesty, an even greater honor awaits Georgie in Nice - as Coco Chanel herself asks Georgie to model her latest fashion. But when a necklace belonging to the Queen is stolen on the catwalk, Georgie has to find two priceless items - and solve a murder. How's a girl to find any time to go to the casino?</p>"; 
